        val polygons: Seq[Polygon] = polygonsWKT.map(g => wktReader.read(g).asInstanceOf[Polygon])
        val emptyGeom: Geometry = geomFactory.createEmpty(2)
        val delta = 0.00001
        assert(
            polygons.forall { p =>
                val subPolygons: List[Polygon] = GeometryUtils.splitPolygon(p)
                val merged = subPolygons.foldLeft(emptyGeom)(_ union _)
                val diff = math.abs(merged.getArea - p.getArea)
                diff < delta
            }
        )
    }


